import React from 'react';

function Contact() {

  const [formValues, setFormValues] = useState({
    fname: '',
    lname: '',
    email: '',
    tel: null,
  })

  return (
    <div className="App">
        <h1>Contact</h1>

        <form>
        <label>

        </label>
          <input type='text' name='fname' placeholder='First Name' value={formValues.fname} />
          <input type='text' name='lname' placeholder='Last Name' value={formValues.lname} />
          <input type='text' name='email' placeholder='Email' value={formValues.email} />
          <input type='number' name='tel' placeholder='Telefon' value={formValues.tel} />

          <input type='submit' />
        </form>
    </div>
  );
}

export default Contact;
